t0.idNivelEncuesta, t11.desTabla as desNivelEncuesta,
t0.comentarioEncuesta,t0.fechaEncuesta from tickets t0 
inner join tablas t1  on t1.tipo = 'TPTK' and t0.tipo =  t1.idTabla
